    "\n  fragment AddFundsAccountQueryHostFields on Host {\n    id\n    type\n    legacyId\n    slug\n    name\n    settings\n    plan {\n      id\n      hostFees\n    }\n    policies {\n      id\n      REQUIRE_2FA_FOR_ADMINS\n    }\n    isTrustedHost\n    vendors(forAccount: { slug: $slug }) {\n      nodes {\n        id\n        slug\n        name\n        type\n        description\n        imageUrl(height: 64)\n      }\n    }\n    orderAccountingCategories: accountingCategories(kind: [CONTRIBUTION, ADDED_FUNDS]) {\n      nodes {\n        id\n        code\n        name\n        friendlyName\n        kind\n        appliesTo\n      }\n    }\n  }\n": typeof types.AddFundsAccountQueryHostFieldsFragmentDoc,
    "\n  query AddFundsAccount($slug: String!) {\n    account(slug: $slug) {\n      id\n      legacyId\n      type\n      isHost\n      name\n      slug\n      currency\n      settings\n      ...AccountHoverCardFields\n      ... on Organization {\n        tiers {\n          nodes {\n            id\n            ...AddFundsTierFields\n          }\n        }\n        host {\n          ...AddFundsAccountQueryHostFields\n        }\n      }\n      ... on AccountWithParent {\n        parent {\n          id\n          slug\n          name\n          imageUrl\n          type\n          settings\n          ...AccountHoverCardFields\n\n          childrenAccounts {\n            nodes {\n              id\n              slug\n              name\n              imageUrl\n              type\n            }\n          }\n        }\n      }\n      childrenAccounts {\n        nodes {\n          id\n          slug\n          name\n          imageUrl\n          type\n        }\n      }\n      ... on Host {\n        ...AddFundsAccountQueryHostFields\n      }\n      ... on AccountWithHost {\n        addedFundsHostFeePercent: hostFeePercent(paymentMethodType: HOST)\n        host {\n          ...AddFundsAccountQueryHostFields\n        }\n      }\n      ... on AccountWithContributions {\n        tiers {\n          nodes {\n            id\n            ...AddFundsTierFields\n          }\n        }\n      }\n    }\n  }\n  \n  \n  \n": typeof types.AddFundsAccountDocument,
    "\n    mutation CreateAddFundsVendor($vendor: VendorCreateInput!, $host: AccountReferenceInput!) {\n      createVendor(host: $host, vendor: $vendor) {\n        id\n        ...VendorFields\n      }\n    }\n    \n  ": typeof types.CreateAddFundsVendorDocument,
    "\n  mutation EditAccountFee($account: AccountReferenceInput!, $hostFeePercent: Float!, $isCustomFee: Boolean!) {\n    editAccountFeeStructure(account: $account, hostFeePercent: $hostFeePercent, isCustomFee: $isCustomFee) {\n      id\n      ... on AccountWithHost {\n        hostFeesStructure\n        hostFeePercent\n      }\n      childrenAccounts {\n        nodes {\n          id\n          ... on AccountWithHost {\n            hostFeesStructure\n            hostFeePercent\n          }\n        }\n      }\n    }\n  }\n": typeof types.EditAccountFeeDocument,
