    "\n  fragment KYCVerificationCollectionFields on KYCVerificationCollection {\n    nodes {\n      ...KYCVerificationFields\n    }\n    limit\n    offset\n    totalCount\n  }\n\n  \n": typeof types.KycVerificationCollectionFieldsFragmentDoc,
