    "\n      query KYCRequestAccountCard($id: String, $slug: String) {\n        account(id: $id, slug: $slug) {\n          ...AccountHoverCardFields\n        }\n      }\n\n      \n    ": typeof types.KycRequestAccountCardDocument,
    "\n      mutation SetRYCRequestIntroductionSkip($account: AccountReferenceInput!, $value: JSON!) {\n        editAccountSetting(account: $account, key: \"kyc.skipRequestIntroduction\", value: $value) {\n          id\n          settings\n        }\n      }\n    ": typeof types.SetRycRequestIntroductionSkipDocument,
    "\n      query KYCRequestModal($requestedByAccountSlug: String!, $verifyAccountId: String, $isAccountSelected: Boolean!) {\n        requestedByAccount: account(slug: $requestedByAccountSlug) {\n          id\n          name\n          settings\n        }\n        verifyAccount: account(id: $verifyAccountId) @include(if: $isAccountSelected) {\n          id\n          name\n          type\n          ... on Individual {\n            kycStatus(requestedByAccount: { slug: $requestedByAccountSlug }) {\n              manual {\n                ...KYCVerificationFields\n              }\n            }\n          }\n        }\n      }\n      \n    ": typeof types.KycRequestModalDocument,
    "\n      mutation RequestManualKYCVerification(\n        $requestedByAccount: AccountReferenceInput!\n        $verifyAccount: AccountReferenceInput!\n        $request: RequestKYCVerificationInput!\n      ) {\n        requestKYCVerification(\n          requestedByAccount: $requestedByAccount\n          verifyAccount: $verifyAccount\n          request: $request\n          provider: MANUAL\n        ) {\n          ...KYCVerificationFields\n        }\n      }\n      \n    ": typeof types.RequestManualKycVerificationDocument,
    "\n  query MemberInvitationsCount($memberAccount: AccountReferenceInput!) {\n    memberInvitations(memberAccount: $memberAccount) {\n      id\n    }\n  }\n": typeof types.MemberInvitationsCountDocument,
