    "\n  query ContributionDrawer($orderId: Int!) {\n    order(order: { legacyId: $orderId }) {\n      id\n      legacyId\n      nextChargeDate\n      lastChargedAt\n      amount {\n        value\n        valueInCents\n        currency\n      }\n      totalAmount {\n        value\n        valueInCents\n        currency\n      }\n      paymentMethod {\n        id\n        type\n      }\n      status\n      description\n      createdAt\n      processedAt\n      frequency\n      tier {\n        id\n        name\n        description\n      }\n      createdByAccount {\n        ...ContributionDrawerAccountFields\n      }\n      individual: createdByAccount {\n        ...ContributionDrawerAccountFields\n      }\n      fromAccount {\n        ...ContributionDrawerAccountFields\n        ... on AccountWithHost {\n          host {\n            id\n            slug\n            type\n          }\n        }\n      }\n      toAccount {\n        ...ContributionDrawerAccountFields\n      }\n      platformTipEligible\n      platformTipAmount {\n        value\n        valueInCents\n        currency\n      }\n      hostFeePercent\n      tags\n      tax {\n        type\n        idNumber\n        rate\n      }\n      accountingCategory {\n        id\n        name\n        friendlyName\n        code\n      }\n      activities {\n        nodes {\n          id\n          type\n          createdAt\n          fromAccount {\n            ...ContributionDrawerAccountFields\n          }\n          account {\n            ...ContributionDrawerAccountFields\n          }\n          host {\n            ...ContributionDrawerAccountFields\n          }\n          individual {\n            ...ContributionDrawerAccountFields\n          }\n          data\n          transaction {\n            ...ContributionDrawerTransactionFields\n          }\n        }\n      }\n      customData\n      memo\n      needsConfirmation\n      pendingContributionData {\n        expectedAt\n        paymentMethod\n        ponumber\n        memo\n        fromAccountInfo {\n          name\n          email\n        }\n      }\n      transactions {\n        ...ContributionDrawerTransactionFields\n      }\n      permissions {\n        id\n        canResume\n        canMarkAsExpired\n        canMarkAsPaid\n        canEdit\n        canComment\n        canSeePrivateActivities\n        canSetTags\n        canUpdateAccountingCategory\n      }\n    }\n  }\n\n  fragment ContributionDrawerAccountFields on Account {\n    id\n    name\n    slug\n    isIncognito\n    type\n    imageUrl\n    isHost\n    isArchived\n    ...AccountHoverCardFields\n    ... on Individual {\n      isGuest\n    }\n    ... on AccountWithHost {\n      host {\n        id\n        slug\n        type\n        accountingCategories {\n          nodes {\n            ...AccountingCategorySelectFields\n          }\n        }\n      }\n      approvedAt\n    }\n    ... on Organization {\n      host {\n        id\n        slug\n        type\n        accountingCategories {\n          nodes {\n            ...AccountingCategorySelectFields\n          }\n        }\n      }\n    }\n\n    ... on AccountWithParent {\n      parent {\n        id\n        slug\n      }\n    }\n  }\n\n  fragment ContributionDrawerTransactionFields on Transaction {\n    id\n    legacyId\n    uuid\n    kind\n    amount {\n      currency\n      valueInCents\n    }\n    netAmount {\n      currency\n      valueInCents\n    }\n    group\n    type\n    description\n    createdAt\n    isRefunded\n    isRefund\n    isOrderRejected\n    account {\n      ...ContributionDrawerAccountFields\n    }\n    oppositeAccount {\n      ...ContributionDrawerAccountFields\n    }\n    expense {\n      id\n      type\n    }\n    permissions {\n      id\n      canRefund\n      canDownloadInvoice\n      canReject\n    }\n    paymentProcessorUrl\n  }\n  \n  \n": types.ContributionDrawerDocument,
