    "\n  fragment HostFields on Host {\n    id\n    legacyId\n    name\n    legalName\n    slug\n    type\n    expensePolicy\n    settings\n    currency\n    requiredLegalDocuments\n    features {\n      id\n      MULTI_CURRENCY_EXPENSES\n    }\n    location {\n      id\n      address\n      country\n    }\n    transferwise {\n      id\n      availableCurrencies\n    }\n    supportedPayoutMethods\n    isTrustedHost\n    vendors(\n      searchTerm: $searchTerm\n      isArchived: $isArchived\n      limit: $limit\n      offset: $offset\n      totalContributed: $totalContributed\n      totalExpended: $totalExpended\n    ) @include(if: $onlyVendors) {\n      totalCount\n      offset\n      limit\n      nodes {\n        id\n        ...VendorFields\n        communityStats(host: { slug: $slug }) {\n          relations\n          transactionSummary {\n            year\n            expenseTotalAcc {\n              valueInCents\n              currency\n            }\n            expenseCountAcc\n            contributionTotalAcc {\n              valueInCents\n              currency\n            }\n            contributionCountAcc\n          }\n        }\n      }\n    }\n  }\n\n  query DashboardVendors(\n    $slug: String!\n    $searchTerm: String\n    $isArchived: Boolean\n    $limit: Int\n    $offset: Int\n    $totalContributed: AmountRangeInput\n    $totalExpended: AmountRangeInput\n    $onlyVendors: Boolean!\n  ) {\n    account(slug: $slug) {\n      id\n      legacyId\n      ... on AccountWithHost {\n        host {\n          id\n          ...HostFields\n        }\n      }\n      ... on Organization {\n        host {\n          id\n          ...HostFields\n        }\n      }\n    }\n    community(\n      host: { slug: $slug }\n      type: [ORGANIZATION]\n      searchTerm: $searchTerm\n      totalContributed: $totalContributed\n      totalExpended: $totalExpended\n      limit: $limit\n      offset: $offset\n    ) @skip(if: $onlyVendors) {\n      totalCount\n      offset\n      limit\n      nodes {\n        id\n        legacyId\n        slug\n        name\n        legalName\n        type\n        imageUrl\n        communityStats(host: { slug: $slug }) {\n          relations\n          transactionSummary {\n            year\n            expenseTotalAcc {\n              valueInCents\n              currency\n            }\n            expenseCountAcc\n            contributionTotalAcc {\n              valueInCents\n              currency\n            }\n            contributionCountAcc\n          }\n        }\n      }\n    }\n  }\n  \n": types.HostFieldsFragmentDoc,
    "\n      query AccountingCategoryTable($hostSlug: String!) {\n        host(slug: $hostSlug) {\n          id\n          type\n        }\n      }\n    ": types.AccountingCategoryTableDocument,
    "\n  query AdminAccountingCategories($hostSlug: String!) {\n    host(slug: $hostSlug) {\n      id\n      type\n      slug\n      accountingCategories {\n        totalCount\n        nodes {\n          ...AccountingCategorySelectFields\n        }\n      }\n    }\n  }\n  \n": types.AdminAccountingCategoriesDocument,
