    "\n  query AddFundsAccount($slug: String!) {\n    account(slug: $slug) {\n      id\n      legacyId\n      type\n      isHost\n      name\n      slug\n      currency\n      settings\n      ...AccountHoverCardFields\n      ... on Organization {\n        tiers {\n          nodes {\n            id\n            ...AddFundsTierFields\n          }\n        }\n        host {\n          ...AddFundsAccountQueryHostFields\n        }\n      }\n      ... on AccountWithParent {\n        parent {\n          id\n          slug\n          name\n          imageUrl\n          type\n          settings\n          ...AccountHoverCardFields\n\n          childrenAccounts {\n            nodes {\n              id\n              slug\n              name\n              imageUrl\n              type\n            }\n          }\n        }\n      }\n      childrenAccounts {\n        nodes {\n          id\n          slug\n          name\n          imageUrl\n          type\n        }\n      }\n      ... on Host {\n        ...AddFundsAccountQueryHostFields\n      }\n      ... on AccountWithHost {\n        addedFundsHostFeePercent: hostFeePercent(paymentMethodType: HOST)\n        host {\n          ...AddFundsAccountQueryHostFields\n        }\n      }\n      ... on AccountWithContributions {\n        tiers {\n          nodes {\n            id\n            ...AddFundsTierFields\n          }\n        }\n      }\n    }\n  }\n  \n  \n  \n": types.AddFundsAccountDocument,
