    "\n      mutation CreateHostedFund($fund: FundCreateInput!, $hostSlug: String!) {\n        createFund(fund: $fund, host: { slug: $hostSlug }) {\n          id\n          name\n          slug\n          tags\n          description\n        }\n      }\n    ": types.CreateHostedFundDocument,
    "\n      query HostedFundsMetadata($hostSlug: String!) {\n        host(slug: $hostSlug) {\n          id\n          currency\n          all: hostedAccounts(limit: 1, accountType: [FUND]) {\n            totalCount\n            currencies\n          }\n          active: hostedAccounts(limit: 1, accountType: [FUND], isFrozen: false) {\n            totalCount\n          }\n          frozen: hostedAccounts(limit: 1, isFrozen: true, accountType: [FUND]) {\n            totalCount\n          }\n          unhosted: hostedAccounts(limit: 1, accountType: [FUND], isUnhosted: true) {\n            totalCount\n          }\n        }\n      }\n    ": types.HostedFundsMetadataDocument,
    "\n      query HostedGrantsMetadata($hostSlug: String!) {\n        host(slug: $hostSlug) {\n          id\n          ...HostInfoCardFields\n          transferwise {\n            id\n            availableCurrencies\n            amountBatched {\n              valueInCents\n              currency\n            }\n          }\n        }\n        pending: expenses(host: { slug: $hostSlug }, status: [PENDING], type: GRANT) {\n          totalCount\n        }\n        approved: expenses(host: { slug: $hostSlug }, status: [APPROVED], type: GRANT) {\n          totalCount\n        }\n        paid: expenses(host: { slug: $hostSlug }, status: [PAID], type: GRANT) {\n          totalCount\n        }\n\n        hostedAccounts: accounts(host: { slug: $hostSlug }, orderBy: { field: ACTIVITY, direction: DESC }) {\n          nodes {\n            id\n            ...AccountHoverCardFields\n          }\n        }\n\n        expenseTags: expenseTagStats(host: { slug: $hostSlug }) {\n          nodes {\n            id\n            tag\n          }\n        }\n      }\n\n      \n      \n    ": types.HostedGrantsMetadataDocument,
