    "\n    mutation PaymentInfoRemovePayoutMethod($payoutMethodId: String!) {\n      removePayoutMethod(payoutMethodId: $payoutMethodId) {\n        id\n        ...PayoutMethodFields\n      }\n    }\n    \n  ": types.PaymentInfoRemovePayoutMethodDocument,
