    "\n  query ManagePaymentMethods($accountSlug: String!) {\n    account(slug: $accountSlug) {\n      id\n      legacyId\n      type\n      slug\n      name\n      legalName\n      currency\n      isHost\n      settings\n      paymentMethods(type: [CREDITCARD, US_BANK_ACCOUNT, SEPA_DEBIT, BACS_DEBIT, GIFTCARD, PREPAID]) {\n        id\n        ...PaymentMethodFields\n      }\n      payoutMethods(includeArchived: true) {\n        id\n        ...PayoutMethodFields\n      }\n    }\n  }\n\n  \n  \n": types.ManagePaymentMethodsDocument,
    "\n  fragment MemberFields on Member {\n    id\n    role\n    since\n    createdAt\n    description\n    inherited\n    account {\n      id\n      name\n      slug\n      type\n      imageUrl(height: 64)\n      ... on Individual {\n        email\n      }\n    }\n  }\n": types.MemberFieldsFragmentDoc,
    "\n  query TeamSection($collectiveSlug: String!, $account: AccountReferenceInput!) {\n    account(slug: $collectiveSlug) {\n      id\n      legacyId\n      slug\n      isFrozen\n      type\n      imageUrl(height: 256)\n      ... on AccountWithParent {\n        parent {\n          id\n          slug\n          type\n          name\n        }\n      }\n      ... on AccountWithHost {\n        host {\n          id\n          slug\n          name\n          features {\n            id\n            CONTACT_FORM\n          }\n          policies {\n            id\n            COLLECTIVE_MINIMUM_ADMINS {\n              numberOfAdmins\n              applies\n              freeze\n            }\n          }\n        }\n      }\n      members(role: [ADMIN, MEMBER, ACCOUNTANT, COMMUNITY_MANAGER], limit: 100) {\n        nodes {\n          id\n          ...MemberFields\n        }\n      }\n      childrenAccounts {\n        nodes {\n          id\n          slug\n          type\n          name\n          members(includeInherited: false, role: [ADMIN, MEMBER, ACCOUNTANT, COMMUNITY_MANAGER], limit: 100) {\n            nodes {\n              id\n              ...MemberFields\n            }\n          }\n        }\n      }\n    }\n    memberInvitations(account: $account) {\n      id\n      role\n      since\n      createdAt\n      description\n      account: memberAccount {\n        id\n        name\n        slug\n        type\n        imageUrl(height: 64)\n        ... on Individual {\n          email\n        }\n      }\n    }\n  }\n  \n": types.TeamSectionDocument,
    "\n  fragment EditTiersFields on Tier {\n    id\n    legacyId\n    amount {\n      value\n      valueInCents\n      currency\n    }\n    amountType\n    availableQuantity\n    button\n    customFields\n    description\n    endsAt\n    frequency\n    goal {\n      value\n      valueInCents\n      currency\n    }\n    interval\n    invoiceTemplate\n    maxQuantity\n    minimumAmount {\n      value\n      valueInCents\n      currency\n    }\n    name\n    presets\n    slug\n    type\n    useStandalonePage\n    singleTicket\n  }\n": types.EditTiersFieldsFragmentDoc,
    "\n  query AccountTiers($accountSlug: String!) {\n    account(slug: $accountSlug) {\n      id\n      ... on AccountWithContributions {\n        tiers {\n          nodes {\n            id\n            ...EditTiersFields\n          }\n        }\n      }\n      ... on Organization {\n        tiers {\n          nodes {\n            id\n            ...EditTiersFields\n          }\n        }\n      }\n    }\n  }\n  \n": types.AccountTiersDocument,
