    "\n  query ExpensesPage(\n    $account: AccountReferenceInput\n    $accountSlug: String\n    $fromAccount: AccountReferenceInput\n    $limit: Int!\n    $offset: Int!\n    $type: ExpenseType\n    $tags: [String]\n    $status: [ExpenseStatusFilter]\n    $amount: AmountRangeInput\n    $payoutMethodType: PayoutMethodType\n    $dateFrom: DateTime\n    $dateTo: DateTime\n    $searchTerm: String\n    $sort: ChronologicalOrderInput\n    $chargeHasReceipts: Boolean\n    $virtualCards: [VirtualCardReferenceInput]\n  ) {\n    account(slug: $accountSlug) {\n      id\n      legacyId\n      slug\n      type\n      imageUrl\n      backgroundImageUrl\n      twitterHandle\n      name\n      currency\n      isArchived\n      isActive\n      settings\n      createdAt\n      supportedExpenseTypes\n      expensesTags {\n        id\n        tag\n      }\n      features {\n        id\n        ...NavbarFields\n      }\n\n      stats {\n        id\n        balance {\n          valueInCents\n          currency\n        }\n        balanceWithBlockedFunds: balance(withBlockedFunds: true) {\n          valueInCents\n          currency\n        }\n      }\n\n      ... on AccountWithHost {\n        isApproved\n        host {\n          id\n          ...ExpenseHostFields\n        }\n      }\n\n      ... on AccountWithParent {\n        parent {\n          id\n          slug\n          imageUrl\n          backgroundImageUrl\n          twitterHandle\n        }\n      }\n\n      ... on Organization {\n        # We add that for hasFeature\n        isHost\n        isActive\n        host {\n          id\n          ...ExpenseHostFields\n        }\n      }\n\n      ... on Event {\n        parent {\n          id\n          name\n          slug\n          type\n        }\n      }\n\n      ... on Project {\n        parent {\n          id\n          name\n          slug\n          type\n        }\n      }\n    }\n    expenses(\n      account: $account\n      fromAccount: $fromAccount\n      limit: $limit\n      offset: $offset\n      type: $type\n      tag: $tags\n      status: $status\n      amount: $amount\n      payoutMethodType: $payoutMethodType\n      dateFrom: $dateFrom\n      dateTo: $dateTo\n      searchTerm: $searchTerm\n      orderBy: $sort\n      chargeHasReceipts: $chargeHasReceipts\n      virtualCards: $virtualCards\n    ) {\n      totalCount\n      offset\n      limit\n      nodes {\n        id\n        ...ExpensesListFieldsFragment\n      }\n    }\n    # limit: 1 as current best practice to avoid the API fetching entries it doesn't need\n    # TODO: We don't need to try and fetch this field on non-host accounts (should use a ... on Host)\n    scheduledExpenses: expenses(\n      host: $account\n      status: SCHEDULED_FOR_PAYMENT\n      payoutMethodType: BANK_ACCOUNT\n      limit: 1\n    ) {\n      totalCount\n    }\n  }\n\n  \n  \n  \n": types.ExpensesPageDocument,
    "\n  query QuoteExpense($id: String!) {\n    expense(expense: { id: $id }) {\n      id\n      currency\n      reference\n      amountInHostCurrency: amountV2(currencySource: HOST) {\n        exchangeRate {\n          value\n          fromCurrency\n          toCurrency\n        }\n      }\n      host {\n        id\n        transferwise {\n          id\n          amountBatched {\n            valueInCents\n            currency\n          }\n          balances {\n            valueInCents\n            currency\n          }\n        }\n      }\n      quote {\n        paymentProcessorFeeAmount {\n          valueInCents\n          currency\n        }\n        sourceAmount {\n          valueInCents\n          currency\n        }\n        estimatedDeliveryAt\n        notices {\n          type\n          text\n        }\n      }\n    }\n  }\n": types.QuoteExpenseDocument,
    "\n  query ValidateTransferRequirements($id: String!, $details: JSON) {\n    expense(expense: { id: $id }) {\n      id\n      validateTransferRequirements(details: $details) {\n        type\n        fields {\n          name\n          group {\n            key\n            name\n            type\n            required\n            example\n            minLength\n            maxLength\n            validationRegexp\n            refreshRequirementsOnChange\n            valuesAllowed {\n              key\n              name\n            }\n          }\n        }\n      }\n    }\n  }\n": types.ValidateTransferRequirementsDocument,
